function imgResize($newname, $srcImg, $width, $height) {
    $filename = $srcImg;
    // Content type
    //header('Content-type: image/jpeg');
    // Get new dimensions
    list($width_orig, $height_orig, $type_orig) = getimagesize($filename);

    if ($width && ($width_orig < $height_orig)) {
        $width = ($height / $height_orig) * $width_orig;
    } else {
        $height = ($width / $width_orig) * $height_orig;
    }

    // Resample
    switch ($type_orig) {
        case 1 :
            $image = imagecreatefromgif($filename);
            break;
        case 2 :
            $image = imagecreatefromjpeg($filename);
            break;
        case 3 :
            $image = imagecreatefrompng($filename);
            break;
    }

    $image_p = imagecreatetruecolor($width, $height);
    imagecopyresampled($image_p, $image, 0, 0, 0, 0, $width, $height, $width_orig, $height_orig);

    // Output
    imagejpeg($image_p, $newname, 100);
    imagedestroy($image);
    imagedestroy($image_p);
}

/*
 * 过滤数组的函数 
 * $arr 处理的数组 $fun 匿名函数
 * return 获得通过的数组
 * */

function filterArr($arr, $fun) {
    $newArr = null;
    foreach ($arr as $key => $value) {
        if ($fun($key, $value))
            $newArr[$key] = $value;
    }

    return $newArr;
}

/*
 * 出入时间搓 输出当前为一年的多少周
 */

function witchWeek($time = null) {
    $data = array(
        '2001' => 1, '2002' => 2, '2003' => 3, '2004' => 4,
        '2005' => 6, '2006' => 7, '2007' => 1, '2008' => 2, '2009' => 4,
        '2010' => 5, '2011' => 6, '2012' => 7, '2013' => 2, '2014' => 3,
        '2015' => 4, '2016' => 5, '2017' => 7, '2018' => 1, '2019' => 2, '2020' => 3,
    );

    $time = !$time ? time() : $time;
    $year = date("Y", $time);
    $day = $data[$year];

    $now = date('z', $time); //当前是今年的第几天

    if ($now == 1 or $now < (7 - $day))
        $week = 1;
    else
        $week = ceil(($now - (7 - $day)) / 7) + 1;

    return $week . '.' . date("y", $time);
}

/*
 * 传入俩个周数 算差值
 * */

function spaceWeek($late, $early) {
    $early = explode('.', $early);
    $late = explode('.', $late);
    if ($early[1] == $late[1]) {
        return $late[0] - $early[0];
    } else {
        $data = array(
            '01' => 1, '02' => 2, '03' => 3, '04' => 4, '05' => 6,
            '06' => 7, '07' => 1, '08' => 2, '09' => 4, '10' => 5,
            '11' => 6, '12' => 7, '13' => 2, '14' => 3, '15' => 4,
            '16' => 5, '17' => 7, '18' => 1, '19' => 2, '20' => 3,
        );

        //计算剩余多少周数
        $initE = $data[$early[1]];
        $a = '20' . $early[1];
        $dayNum = ($a % 4 == 0) && ($a % 100 != 0) || ($a % 400 == 0) ? 366 : 365;

        $weekE = ceil(($dayNum - (7 - $initE)) / 7) - $early[0];

        return $weekE + $late[0];
    }
}

/*
 * 清除掉数组中的某个值
 * */

function delArrValue($arr, $val) {
    foreach ($arr as $key => $value)
        if ($value == $val)
            unset($arr[$key]);
    return $arr;
}

/**
 * retPage()获取翻页结果集合
 * @param Obj $retObj 结果集对象
 * @param int $page 页数
 * @param int $count 每页条数
 * @return array
 */
function retPage($retObj, $page, $count = 10) {
    if (is_array($retObj)) {
        $start = ($page == 1) ? 0 : ($count * ($page - 1) + 1);
        $page_return["items"] = array_slice($retObj, $start, $count);
        $page_return["before"] = ($page == 1) ? 1 : ($page - 1);
        $page_return["next"] = ($page == ceil(count($retObj) / $count)) ? $page : ($page + 1);
        $page_return["last"] = ceil(count($retObj) / $count);
        $page_return["current"] = $page;
        $page_return["total_pages"] = ceil(count($retObj) / $count);
        $page_return = (object)$page_return;
    } else {
        $paginator = new \Phalcon\Paginator\Adapter\Model(
            array(
                "data" => $retObj,
                "limit" => $count,
                "page" => $page
            )
        );
        $page_return = $paginator->getPaginate();
    }
    return $page_return;
}

