/**
 * 获取两个坐标的距离
 */
function getDistance($lng1, $lat1, $lng2, $lat2) {
    $radLat1 = deg2rad($lat1);
    $radLat2 = deg2rad($lat2);
    $radLng1 = deg2rad($lng1);
    $radLng2 = deg2rad($lng2);
    $a = $radLat1 - $radLat2;
    $b = $radLng1 - $radLng2;
    $s = 2 * asin(sqrt(pow(sin($a / 2), 2) + cos($radLat1) * cos($radLat2) * pow(sin($b / 2), 2))) * 6378.137 * 1000;
    return $s;
}

/**
 * 生成二维码并加上logo
 */
function createQR($qrcode_content, $path) {
    \QRcode::png($qrcode_content, $path, 'M', 5); //5

    $big = imagecreatefrompng($path);
    $small = imagecreatefrompng('qrcode/logo.png');

    $begin = floor((imagesx($big) - imagesx($small)) / 2); //echo $begin;exit();
    imagecopymerge($big, $small, $begin, $begin, 0, 0, 48, 48, 100);
    imagepng($big, $path);
    imagedestroy($big);
    imagedestroy($small);
}

