/**
 * 接口调用
 *
 * @param string $uri
 * @param string $data
 *
 */
function curlSetopt($uri, $data) {
    if (check_remote_file_exists($uri)) {
        $ch = curl_init();
        curl_setopt($ch, CURLOPT_POST, true);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
        curl_setopt($ch, CURLOPT_URL, $uri);
        curl_setopt($ch, CURLOPT_POSTFIELDS, $data);
        $response = curl_exec($ch);
        curl_close($ch);
        return json_decode($response, true);
    } else {
        return array('status' => 5000);
    }
}

function execUpload($uri, $data) {
    return true;
    $ch = curl_init();
    curl_setopt($ch, CURLOPT_HEADER, false);
    //启用时会发送一个常规的POST请求，类型为：application/x-www-form-urlencoded，就像表单提交的一样。
    curl_setopt($ch, CURLOPT_POST, true);
    curl_setopt($ch, CURLOPT_BINARYTRANSFER, true);
    curl_setopt($ch, CURLOPT_POSTFIELDS, $data);
    curl_setopt($ch, CURLOPT_URL, $uri);
    $info = curl_exec($ch);
    curl_close($ch);
}

/**
 * 接口调用记录错误日志
 *
 * @param type $filename
 * @param type $msg
 */
function logFile($filename, $msg) {
    $save_path = __ROOT__ . '/public/log/';
    if (!file_exists($save_path)) {
        mkdir($save_path, 0777);
    }
    //创建文件夹
    $ymd = date("Y-m-d");
    $save_path .= $ymd . "/";

    if (!file_exists($save_path)) {
        mkdir($save_path);
    }
    chmod($save_path, 0777);
    //打开文件
    $fd = fopen($save_path . $filename, "a");
    //增加文件
    $str = "[" . date("Y/m/d h:i:s", time()) . "]" . $msg;
    //写入字符串
    fwrite($fd, $str . "\r\n");
    //关闭文件
    fclose($fd);
}

/**
 * 接口调用记录错误日志
 *
 * @param type $filename
 * @param mixed $model string or Model or array
 */
function logDebug($name, $content = null, $model = null, $type = 0, $pk = null, $level = 0) {
    /**
     * @var \Phalcon\Mvc\Model $model
     * @var \Phalcon\Validation\MessageInterface $msg
     */
    $debug = new \DebugModel();
    $debug->name = $name;

    if (is_array($content))
        $content = json_encode($content);

    $debug->content = $content;

    if ($model && $model instanceof \Phalcon\Mvc\Model) {
        $debug->data = json_encode($model->toArray());
        $err = array();
        foreach ($model->getMessages() as $msg) {
            $err[] = $msg->getMessage();
        }
        $debug->error = json_encode($err);
    } elseif (is_array($model)) {
        $debug->data = json_encode($model);
    }

    $debug->typeid = $type;
    $debug->pk = $pk;
    if (empty($level))
        $level = DebugModel::LEVEL_DEBUG;

    $debug->level = $level;
    if (!$debug->save())
        throw new \Common\Bases\Exception('debug failed', 0, null, $debug);

}

