/* * *******************************************************************
  函数名称:encrypt
  函数作用:加密解密字符串
  使用方法:
  加密     :encrypt('str','E','nowamagic');
  解密     :encrypt('被加密过的字符串','D','nowamagic');
  参数说明:
  $string   :需要加密解密的字符串
  $operation:判断是加密还是解密:E:加密   D:解密
  $key      :加密的钥匙(密匙);
 * ******************************************************************* */

function encrypt($string, $operation, $key = '') {
    $key = md5($key);
    $key_length = strlen($key);
    $string = $operation == 'D' ? base64_decode($string) : substr(md5($string . $key), 0, 8) . $string;
    $string_length = strlen($string);
    $rndkey = $box = array();
    $result = '';
    for ($i = 0; $i <= 255; $i++) {
        $rndkey[$i] = ord($key[$i % $key_length]);
        $box[$i] = $i;
    }
    for ($j = $i = 0; $i < 256; $i++) {
        $j = ($j + $box[$i] + $rndkey[$i]) % 256;
        $tmp = $box[$i];
        $box[$i] = $box[$j];
        $box[$j] = $tmp;
    }
    for ($a = $j = $i = 0; $i < $string_length; $i++) {
        $a = ($a + 1) % 256;
        $j = ($j + $box[$a]) % 256;
        $tmp = $box[$a];
        $box[$a] = $box[$j];
        $box[$j] = $tmp;
        $result .= chr(ord($string[$i]) ^ ($box[($box[$a] + $box[$j]) % 256]));
    }
    if ($operation == 'D') {
        if (substr($result, 0, 8) == substr(md5(substr($result, 8) . $key), 0, 8)) {
            return substr($result, 8);
        } else {
            return '';
        }
    } else {
        return str_replace('=', '', base64_encode($result));
    }
}


/**
 * 邮件发送
 * @param type $to
 * @param type $content
 * @param type $toName
 * @return boolean
 */
function sendEmail($to, $content, $toName, $title = '异常订单', $fromName = "error.log") {
    include 'PHPMailer.php';
    include 'SMTP.php';

    $charset = 'utf-8';
    header('Content-Type: text/html; charset=' . $charset);

    $from = 'error@kanguo.com';
    $title = $title;
    $attachment = '';
    $mail = new PHPMailer();
    $mail->CharSet = $charset; //设置采用gb2312中文编码
    $mail->IsSMTP(); //设置采用SMTP方式发送邮件
    $mail->Host = "smtp.exmail.qq.com"; //设置邮件服务器的地址
    $mail->Port = 25; //设置邮件服务器的端口，默认为25
    $mail->From = $from; //设置发件人的邮箱地址
    $mail->FromName = $fromName; //设置发件人的姓名
    $mail->SMTPAuth = true; //设置SMTP是否需要密码验证，true表示需要
    $mail->Username = $from; //设置发送邮件的邮箱
    $mail->Password = "20141224Error!"; //设置邮箱的密码
    $mail->Subject = $title; //设置邮件的标题
    $mail->AltBody = "text/html"; // optional, comment out and test
    $mail->Body = $content; //设置邮件内容
    $mail->IsHTML(true); //设置内容是否为html类型
    $mail->WordWrap = 50; //设置每行的字符数
    //$mail->AddReplyTo("地址", "名字"); //设置回复的收件人的地址
    $mail->AddAddress($to, $toName); //设置收件的地址
    if ($attachment != '') { //设置附件
        $mail->AddAttachment($attachment, $attachment);
    }
    if (!$mail->Send()) {
        return false;
    } else {
        return true;
    }
}

