//将数组中所有值转化为string类型
function set_array_value_by_string($array) {
    if (is_array($array)) {
        foreach ($array as $k => $a) {
            if (is_array($a) && count($a)) {
                $array[$k] = set_array_value_by_string($a);
            } elseif (is_array($a)) {
                $array[$k] = array();
            } else {
                $array[$k] = strval($a);
            }
        }
        return $array;
    } else {
        return strval($array);
    }
}

//判断远程文件
function check_remote_file_exists($url) {
    $curl = curl_init($url);
    // 不取回数据
    curl_setopt($curl, CURLOPT_NOBODY, true);
    // 发送请求
    $result = curl_exec($curl);
    $found = false;
    // 如果请求没有发送失败
    if ($result !== false) {
        // 再检查http响应码是否为200
        $statusCode = curl_getinfo($curl, CURLINFO_HTTP_CODE);
        if ($statusCode == 200) {
            $found = true;
        }
        curl_close($curl);
        return $found;
    }
}


