/**
 * 确认路径结束符和开始符号
 * @author wjh
 * @date 2016-6-16
 * @param string $path 路径
 * @param bool $suffixes 是否后缀
 * @param bool $prefix 是否前缀
 * @return bool|string
 */
function ensure_url_separator($path,$suffixes = true,$prefix = false){
    $url_separator = '/';
    $path = trim($path);
    if (empty($path))
        return false;

    $last = substr($path,-1);
    $first = substr($path,0,1);
    if ($suffixes){
        if ($last != $url_separator)
            $path .= $url_separator;
    }
    else{
        if ($last == $url_separator)
            $path = substr($path,0,-1);
    }

    if ($prefix){
        if ($first != $url_separator)
            $path = $url_separator . $path;
    }
    else{
        if ($first == $url_separator)
            $path = substr($path,1);
    }
    return $path;
}


