/*后台取消(退款)操作通知和合谷*/
function orderCancel($order_id) {
    if ($order_id) {
        $order = \OrderModel::findFirst("order_id=" . $order_id);
        if ($order) {
            $method = 'send.order.cancel';
            $data = array("order_no" => $order->third_order_id, 'type' => '4', 'reason' => '用户取消订单');
            $json_data = json_encode($this->waimaiSignFun($method, $data));
            //d($json_data);exit;
            logFile("hhginterfaceError.log", "取消订单数据======" . $json_data);
            $return_content = $this->http_post_data(HHG_ZZ_POST_URL, $json_data);
            $info = json_decode($return_content[1]);
            logFile("hhginterfaceError.log", "和合谷通知数据======" . $return_content[1]);
            $body = $info->body;
            $data = $body->data;
            if ($body->code == 1) {
                if ($data->refund == 1) {//直接退款
                    $order->state = 3;
                    $order->save();

                    /*生成退款订单*/
                    $refundOrder = new \RefundOrderModel();
                    $refund_order_id = '8' . substr($order_id, 1, 21);
                    $refundOrder->order_id = $order_id;
                    $refundOrder->refund_order_id = $refund_order_id;
                    $refundOrder->refund_status = 1;
                    $refundOrder->save();
                } elseif ($data->refund == 0) {//等待审核
                    logFile("hhginterfaceError.log", "退款订单号====" . $order_id . "正在等待审核。。。");
                }
            }
        }
    }
}


/*
 * 执行url post
 */

function http_post_data($url, $data_string) {

    $ch = curl_init();
    curl_setopt($ch, CURLOPT_POST, 1);
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_POSTFIELDS, $data_string);
    curl_setopt($ch, CURLOPT_HTTPHEADER, array(
            'Content-Type: application/json; charset=utf-8',
            'Content-Length: ' . strlen($data_string))
    );
    ob_start();
    curl_exec($ch);
    $return_content = ob_get_contents();
    ob_end_clean();

    $return_code = curl_getinfo($ch, CURLINFO_HTTP_CODE);
    return array($return_code, $return_content);
}

/**
 * 获取签名后的数据信息
 * @param unknown $method 请求命令方法
 * @param unknown $data 数据信息
 */
function waimaiSignFun($method, $data) {
    $dataArr = array(
        'method' => $method,
        'timestamp' => time(),
        'version' => 1,
        'ticket' => $this->uuid(),
        'appid' => HHG_APPID,
        'secret' => HHG_SECRET,
        'body' => $data
    );
    $this->ksort_recursive($dataArr);
    $sign = strtoupper(md5(json_encode($dataArr)));
    $dataArr['sign'] = $sign;
    unset($dataArr['secret']);
    return $dataArr;
}

/**
 * 对数组按照键值递归排序
 * @param unknown $data
 */
function ksort_recursive(&$data) {
    ksort($data);
    foreach ($data as &$vo) {
        if (is_array($vo)) {
            $this->ksort_recursive($vo);
        }
    }
}

/**
 * 获取uuid值
 * @return string
 */
function uuid() {
    mt_srand((double)microtime() * 10000);
    $charid = strtoupper(md5(uniqid(rand(), true)));
    $hyphen = chr(45); //"-"
    $uuid = substr($charid, 0, 8) . $hyphen . substr($charid, 8, 4)
        . $hyphen . substr($charid, 12, 4) . $hyphen . substr($charid, 16, 4)
        . $hyphen . substr($charid, 20, 12);
    return $uuid;
}

/**
 * 获取时间当天、周、月
 * @param type $date
 * @param type $t
 * @param type $n
 * @return array
 */
function get_date($date, $t = 'd', $n = 0) {
    if ($t == 'd') {
        $firstday = date('Y-m-d 00:00:00', strtotime("$n day"));
        $lastday = date("Y-m-d 23:59:59", strtotime("$n day"));
    } elseif ($t == 'w') {
        if ($n != 0) {
            $date = date('Y-m-d', strtotime("$n week"));
        }
        $lastday = date("Y-m-d 23:59:59", strtotime("$date Sunday"));
        $firstday = date("Y-m-d 00:00:00", strtotime("$lastday -6 days"));
    } elseif ($t == 'm') {
        if ($n != 0) {
            $date = date('Y-m-d', strtotime("$n months"));
        }
        $firstday = date("Y-m-01 00:00:00", strtotime($date));
        $lastday = date("Y-m-d 23:59:59", strtotime("$firstday +1 month -1 day"));
    }
    return array($firstday, $lastday);
}

