//时间文字显示
function tranTime($time) {

    $rtime = date("m-d H:i", $time);

    $rtime2 = date("Y-m-d H:i", $time);

    $htime = date("H:i", $time);

    $year1 = date('Y', $time);

    $year2 = date('Y');

    $time = time() - $time;

    if ($time < 60) {

        $str = '刚刚';
    } elseif ($time < 60 * 60) {

        $min = floor($time / 60);

        $str = $min . ' 分钟前';
    } elseif ($time < 60 * 60 * 24) {

        $h = floor($time / (60 * 60));

        $str = $h . '小时前 ' . $htime;
    } elseif ($time < 60 * 60 * 24 * 3) {

        $d = floor($time / (60 * 60 * 24));

        if ($d == 1)
            $str = '昨天 ' . $htime;
        else
            $str = '前天 ' . $htime;
    } elseif ($time < 60 * 60 * 24 * 7) {

        $d = floor($time / (60 * 60 * 24));

        $str = $d . ' 天前 ' . $htime;
    } elseif ($year2 - $year1 < 1) {

        $str = $rtime;
    } else {

        $str = $rtime2;
    }

    return $str;
}


