function short_url($url) {
    $result = sprintf("%u", crc32($url));
    $show = '';
    while ($result > 0) {
        $s = $result % 62;
        if ($s > 35) {
            $s = chr($s + 61);
        } elseif ($s > 9 && $s <= 35) {
            $s = chr($s + 55);
        }
        $show .= $s;
        $result = floor($result / 62);

    }


    if (!\ShortUrlModel::findFirst('url_key="/' . $show . '"') && $show) {
        $shortUrl = new \ShortUrlModel();
        $short_array['url_key'] = '/' . $show;
        $short_array['url'] = $url;
        $shortUrl->create($short_array);
    }
    return $show;
}






