	//根据文件地址 读取 excel 内容
	function read_excel_file($file_url){
		/** Include PHPExcel */
		require_once 'PHPExcel.php';
		require_once 'PHPExcel/IOFactory.php';
		require_once 'PHPExcel/Reader/Excel5.php';
		try {
			// 判断文件是否存在 
			if (!file_exists($file_url)) {
				return false;
			}
			$reader = PHPExcel_IOFactory::createReaderForFile($file_url); //设置以Excel5格式(Excel97-2003工作簿)
			$PHPExcel = $reader->load($file_url); // 载入excel文件
			$sheet = $PHPExcel->getSheet(0); // 读取第一個工作表
			$highestRow = $sheet->getHighestRow(); // 取得总行数
			$highestColumm = $sheet->getHighestColumn(); // 取得总列数
			
			$dataset = null;
			/** 循环读取每个单元格的数据 */
			for ($row = 1; $row <= $highestRow; $row++){//行数是以第1行开始
				for ($column = 'A'; $column <= $highestColumm; $column++) {//列数是以A列开始
					$dataset[$column.$row] = $sheet->getCell($column.$row)->getValue();
					//echo $column.$row.":".$sheet->getCell($column.$row)->getValue()."<br />";
				}
			}
			return $dataset;
		} catch (Exception $e) {
			return false;
		}
	}


	
	//汉字转拼音  $value 字符串内容   $first 不为空时 返回汉字的大写首字母
	function PinYin($value,$first = null){ 
		//$s = preg_replace("/\s/is", "_", $s); 
		//$s = preg_replace("/(|\~|\`|\!|\@|\#|\$|\%|\^|\&|\*|\(|\)|\-|\+|\=|\{|\}|\[|\]|\||\\|\:|\;|\"|\'|\<|\,|\>|\.|\?|\/)/is", "", $s); 
		$py = ""; 
		$i = 0; 
		// 加入这一句，自动识别utf-8 
		$s = iconv('utf-8', 'gbk', $value); 
		for($i = 0;$i < strlen($s);$i++){ 
			if(ord($s[$i]) > 128){ 
				// if($py!="")$py.="_"; 
				if($first){
					$py .= strtoupper(asi2py(ord($s[$i]) + ord($s[$i + 1]) * 256)); 
				}else{
					$py .= strtoupper(substr(asi2py(ord($s[$i]) + ord($s[$i + 1]) * 256),0,1)); 
				}
				$i++; 
			}else{ 
				$py .= $s[$i]; 
			} 
			if(strlen($py) >= 20)return $py; 
		} 
		return $py; 
	} 
	  
	function asi2py($a){ 
		$py = py_class(); 
		if(isset($py[$a])){
			return $py[$a];
		}
		return $a;
	} 
	
	
