/*商户后台菜品导出excel方法
* $arr 需要导入的数据，为数组
* $title 表格标题
*/
function expProductsExcel2($title, $arr) {
    //d($arr3);exit;
    /** Error reporting */
    error_reporting(E_ALL);
    date_default_timezone_set('Europe/London');
    ini_set("memory_limit", -1);
    ini_set('max_execution_time', '1000');
    /** Include PHPExcel */
    require_once 'PHPExcel.php';
    // Create new PHPExcel object
    $objPHPExcel = new PHPExcel();

    //设置标题
    $len = count($title);
    for ($i = 0; $i < $len; $i++) {
        $objPHPExcel->setActiveSheetIndex(0)->setCellValueByColumnAndRow($i,1, $title[$i]);
        //$objPHPExcel->setActiveSheetIndex(0)->setCellValueByColumnAndRow($i,3, $arr3[$i]['totalNum']." ");
    }
    $modellen = count($arr);
    $m = 2;
    for ($i = 0; $i < $modellen; $i++) {
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('A' . $m, $arr[$i]['id']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('B' . $m, $arr[$i]['food_name']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('C' . $m, $arr[$i]['shorthand_code']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('D' . $m, $arr[$i]['cid']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('E' . $m, $arr[$i]['tag_name']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('F' . $m, $arr[$i]['price']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('G' . $m, $arr[$i]['inventory']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('H' . $m, $arr[$i]['state']);
        $objPHPExcel->setActiveSheetIndex(0)->setCellValue('I' . $m, $arr[$i]['is_discount']);
        $m++;
    }
    // Rename worksheet
    $objPHPExcel->getActiveSheet()->setTitle('Simple');
    // Set active sheet index to the first sheet, so Excel opens this as the first sheet
    $objPHPExcel->setActiveSheetIndex(0);
    // Redirect output to a client’s web browser (Excel5)
    header('Content-Type: application/vnd.ms-excel');
    header('Content-Disposition: attachment;filename="products.xlsx"');
    header('Cache-Control: max-age=0');

    $objWriter = PHPExcel_IOFactory::createWriter($objPHPExcel, 'Excel2007');
    $objWriter->save('php://output');
    exit;


}

	







